                <YouTubeComp time="8.10" />   
                <YouTubeComp  time="9.10"/>    
                <YouTubeComp  time="10.10"/>    
                <YouTubeComp  />    
            </div>
          
           )
    }                                                                                                                                                                                                                                                               
}

export default Home;
